import * as React from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

interface IProps {
}

export class Navbar extends React.Component<IProps, {}> {
    render() {
      return (
        <nav className="bg-beige-800 p-4 shadow-md">
          <div className="container mx-auto">
            <ul className="flex space-x-4">
              <li>
                <Link to='/signup' className="text-white hover:text-blue-300">Sign Up</Link>
              </li>
              <li>
                <Link to='/login' className="text-white hover:text-blue-300">Login</Link>
              </li>
            </ul>
          </div>
        </nav>
      )

    }
}

export default Navbar;
